import React from 'react'
import Profile from "./Profile";
import EditQuestions from "./EditQuestions";
import LogDay from "./LogDay";

function Main(){

    const testQSet = [
        {qText: "q1: bool", qType: "boolean", qDate: new Date('2019-06-28')},
        {qText: "q2: bool", qType: "boolean", qDate: new Date('2020-07-28')},
        {qText: "q3: Text", qType: "text", qDate: new Date('2021-08-28')},
        {qText: "q4: Number", qType: "number", qDate: new Date('2021-09-28')},
        {qText: "q5: multiple", qType: "multiple", qDate: new Date(), qChoices: ["Ok day", "Great Day", "Bad day"]},
    ];

    return (
        <div className="Main">
            <div className= "MenuBar" >

                <h2 className="Header">Day Logger</h2>

                <div className= "Menus" style={{display: 'flex'}}>
                    <button>Log Day</button>
                    <button>Edit Questions</button>
                    <button>View Data</button>
                </div>

                <button>profile img</button>
            </div>
            {/*<Profile></Profile>*/}
            {/*<EditQuestions questions = {testQSet}></EditQuestions>*/}
            <LogDay questions={testQSet}></LogDay>

        </div>

    );
}

export default Main
